import { Switch, Route } from 'react-router-dom'
import AddProject from '../../Project/AddProject'
import React from 'react'

const ProjectRoute = () => {
  return (
    <div className="container">
      <Switch>
        <Route path="/projects/add" component={AddProject}/>
      </Switch>
    </div>
  )
}

export default ProjectRoute
